import createLucideIcon from '../createLucideIcon';

const ToggleLeft = createLucideIcon('ToggleLeft', [
  [
    'rect',
    {
      x: '2',
      y: '6',
      width: '20',
      height: '12',
      rx: '6',
      ry: '6',
      key: 'cdopvd',
    },
  ],
  ['circle', { cx: '8', cy: '12', r: '2', key: '1nvbw3' }],
]);

export default ToggleLeft;
